package com.uhc.map.entity;

public class LabCl {

	public LabCl() {
		// TODO Auto-generated constructor stub
	}

	private int labClKey;
	private String loinc;
	private String name;
	private String cpt;
	private String nlpkey;
	private String labTestname;
	private String name_exp;

	public int getLabClKey() {
		return labClKey;
	}

	public void setLabClKey(int labClKey) {
		this.labClKey = labClKey;
	}

	public String getLoinc() {
		return loinc;
	}

	public void setLoinc(String loinc) {
		this.loinc = loinc;
	}

	public String getName() {
		return name;
	}

	public void setName(String name) {
		this.name = name;
	}

	public String getCpt() {
		return cpt;
	}

	public void setCpt(String cpt) {
		this.cpt = cpt;
	}

	public String getNlpkey() {
		return nlpkey;
	}

	public void setNlpkey(String nlpkey) {
		this.nlpkey = nlpkey;
	}

	public String getLabTestname() {
		return labTestname;
	}

	public void setLabTestname(String labTestname) {
		this.labTestname = labTestname;
	}

	public String getName_exp() {
		return name_exp;
	}

	public void setName_exp(String name_exp) {
		this.name_exp = name_exp;
	}

}
